import React from "react";
import "./styles.css";
import { propTypes } from "prop-types";

App.propTypes = {
  firstName: propTypes.string.isRequired,
  lastName: propTypes.string.isRequired
};

export default function App(props) {
  return (
    <div className="App">
      Hello {props.firstName} {props.lastName} !
    </div>
  );
}
